import './SearchStyles/SearchBar.scss'
function SearchBar(){
    return(
        <div className="searchBar">
        <input type="text" name="name" placeholder='Search by coin'/>
        <input type="text" name="name" placeholder='Price from'/>
        <input type="text" name="name" placeholder='Price to'/>
        </div>
    )
}

export default SearchBar
